            <iframe title="hi" src="https://docs.google.com/document/d/e/2PACX-1vSbEKG9T7CIVYhahUfst-SKZ3WAm-cFBi3HOYEgROgzr5OLYMLujKGYtIQsaBVB08VBUonld0Vsv7hM/pub?embedded=true" width="900px" height="600px"></iframe>
        </div>
        
    )
}

export default DocumentScreen
